// Package decoy contains data for decoy files
package decoy

import (
	"fmt"
)

type DataOriginal struct {
	EntropyShould float64
	DataHex       string
}

const (
	// Data01Hex contains a string with binary hex data for a docx document (invoice)
	Data01Hex string = ""
)

var (
	// Data01 =====
	// Entropy: 7.912372527102736
	Data01 *DataOriginal = &DataOriginal{}
)

func init() {
	fmt.Println("Preparing decoy files...")

	Data01.EntropyShould = 7.912372527102736
	Data01.DataHex = Data01Hex
}
